import React from 'react';
import ReactDOM from 'react-dom';
import { Grid } from '@material-ui/core';
import Sidebar from './components/Sidebar';
import {BalanceGroup} from './components/BalanceGroup'
import * as serviceWorker from './serviceWorker';
import 'leaflet/dist/leaflet.css';

ReactDOM.render(
  <React.StrictMode>
    <Grid container>
    <Grid item xs={1} sm={2} md={3} lg={4} xl={5} style={{background: '#d3bcdb'}}>
          {/* <Sidebar class='grid-sidebar'/> */}
          sidebar
    </Grid>
  <Grid container xs={11} sm={10} md={9} lg={8} xl={7} style={{background: '#e9fc95'}}>
     Hooray something is here!
     <Grid item xs={6} sm={6} md={6} lg={6} xl={5} style={{background: '#4c98ac'}}>
           item 1
     </Grid>
     <Grid item xs={6} sm={6} md={6} lg={4} xl={5} style={{background: '#ed97bc'}}>
           item 2
     </Grid>
  </Grid>

</Grid>
    {/* <div class='grid-container'>

      <div class='header'/>
      <div class = 'content'/> */}
    {/* </div> */}

  {/* <BalanceGroup/> */}
</React.StrictMode>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
